from flask import Flask, request, g
import sqlite3
app = Flask(__name__)

DATABASE = 'wishes.db'

def get_db():
    db = getattr(g, '_database', None)
    if db is None:
        db = g._database = sqlite3.connect(DATABASE)
    return db

@app.route('/grantwish', methods=['POST'])
def grant_wish():
    wish = request.form['wish']

    query = f"INSERT INTO wishes (wish) VALUES ('{wish}')"

    db = get_db()
    cursor = db.cursor()
    cursor.execute(query)
    db.commit()

    return {'status': 'Wish added'}

@app.route('/viewwishes')
def view_wishes():
    query = "SELECT * FROM wishes"
    db = get_db()
    cursor = db.cursor()
    cursor.execute(query)
    wishes = cursor.fetchall()
    return {'wishes': wishes}

from flask import Flask, request

app = Flask(__name__)

@app.route("/")
def index():
    name = request.args.get('name', '')
    greeting = request.args.get('greeting', 'Hello')

    if name:
        message = "<p>%s %s!</p>" % (greeting, name)
    else:
        message = '<p>Welcome!</p>'

    return message
